import axios from "axios";

export default function Files() {
    // get data from API
    const [items, etItems] = useState('');
    const apiUrl = "http://localhost:4000/files/all";
    const token = localStorage.getItem('auth-token');

    axios.get(apiUrl, {
        headers: {
            'x-auth-token': token
        }
    })
    .then((res) => {
        console.log(res.data);
    })
    .catch((error) => {
        console.error(error);
    });

    return (
        <div>
            <h2>Library</h2>
        </div>
    );
}
